list.item:
In gemeentelijke bouwverordeningen diende vermeld te zijn aan welke eisen woningen moesten voldoen (art. 3):

plaatsing van de gebouwen ten opzichte van de openbare weg (rooilijnen) en van elkaar;

het hoogtepeil van de benedenvloer en de hoogte van gebouwen;

afmetingen van kamers, trappen en portalen;

privaten;

beschikbaarheid van drinkwater;

voorkoming van brandgevaar;

voorkoming van vochtigheid;

hechtheid van fundamenten, muren, vloeren, trappen, zoldering en dak;

verwijdering van rook, water en vuil;

toevoer van licht en lucht.
							 In geval van bezwarenprocedures (art. 4) diende de inspecteur van advies.

De Hypotheekregeling 1940/1941: besluit van de Regeringscommissaris voor de Wederopbouw van 13 augustus 1940; hypotheekverstrekking van rijkswege voor middenstands- en arbeiderswoningen (herstel oorlogsschade).


art. 19 hypotheekaanvragen via het gemeentebestuur naar de RC voor de Wederopbouw en naar de hoofdinspecteur;

art. 28 kennisgeving van de aanvang van de bouw via de gemeente aan de hoofdinspecteur;

art. 29 de hypotheekgever is verplicht de hoofdinspecteur opgave te verstrekken van lonen en materiaalprijzen.

odd.p:
Openbare archiefstukken kunnen online worden aangevraagd en gereserveerd. U kunt dit ook via de terminals in de studiezaal van het Nationaal Archief doen. Om te kunnen reserveren dient u de volgende stappen te volgen: 

U maakt een profiel aan op www.gahetna.nl, en logt vervolgens in;

Via de archiefinventaris (alleen de beschrijvingen met rode nummers) selecteert u het gewenste archiefstuk door op de knop 'Reserveren' te klikken;

In het volgende scherm geeft u aan op welke dag u het archiefstuk wilt inzien;

Indien u zich bevindt in de studiezaal en een tafelnummer heeft ontvangen kunt u dit nummer vermelden. Als u geen tafelnummer heeft kunt u tafelnummer 777 laten staan;

Vervolgens bevestigt u uw reservering door deze te versturen.
